def process_lyric(s, lower=True):
	# print(s)
    table = str.maketrans({key: None for key in string.punctuation})
    t = s.translate(table) 
    t = ' '.join(t.splitlines())
    if lower:
        t = t.lower()
    return t


'''
Loads a dict of artist to count
'''

def load_artist_count(filename):
    artists = {}
    with open(filename) as csvfile:
        reader = csv.DictReader(csvfile)
        for row in reader:
            a = row['artist']
            if a not in artists:
                artists[a] = {'count':0}
            artists[a]['count'] += 1
    return artists

def filter_data_by_count(data, thresh=100):
    temp = data.copy()
    del_arr = []
    for t in temp:
        if temp[t]['count'] < thresh:
            del_arr.append(t)
    for d in del_arr:
        del temp[d]
    return temp

def plot_counts(data):
    num_songs = []
    for t in data:
        num_songs.append(data[t]['count'])
    plt.hist(num_songs)

def print_genre_statistics(data):
    genres = {}
    for t in data:
        g = data[t]['genre']
        if g not in genres:
            genres[g] = 0
        genres[g] += 1
    print(genres)


# Load in file of artist similarities and return list of (artist1, artist2, similarity score) tuples
def load_similarity(filename):

    artist_scores = [] # list of (artist1, artist2, similarity score tuples)
    artist_pairs = defaultdict(bool) # dict from (artist1, artist2) pair to whether we have a score for them or not yet, deals with (artist1, artist2) and (artist2, artist1) pairs

    with open(filename, encoding="utf8") as csvfile:
        reader = csv.DictReader(csvfile)
        for row in reader:
            main_artist, sim_artist, score = row['main_artist'], row['sim_artist'], row['score']
            score = float(score)

            if artist_pairs[(main_artist, sim_artist)] == True:
                continue

            artist_scores.append((main_artist, sim_artist, score))
            artist_pairs[(main_artist, sim_artist)] = True
            artist_pairs[(sim_artist, main_artist)] = True

    return artist_scores


